import React from 'react'

const EditGoal = props => {
  return (
    props.props.goal.id === parseInt(props.props.match.params.goalId) ?
    (<div className='grid-container'>
      <div className='grid-item'>
        <h4>Goal Date:</h4> {props.goal.goalDate}
        <h4>Bedtime Target:</h4>  {props.goal.bedtimeTarget}
        <h4>Wakeup Time Target:</h4> {props.goal.wakeupTarget}

        <br />

        <button type='button' onClick={props.handleEdit}>edit</button>
      </div>
    </div>) : null
  )
}

export default EditGoal
